export default decreasing;

import {increasing as _increasing} from '@total-order/primitive';

const increasing = (a, b) => _increasing(a, b);
export default increasing;

import {copy} from '@array-like/copy';

export function mock(compare, a, i, j) {
	const x = Array.prototype.slice.call(a, i, j);
	x.sort(compare);
	copy(x, 0, j - i, a, i);
}

